import React, { useState } from 'react';

const Counter = () => {
    const [count, setCount] = useState(10);

    const increment = () => setCount(count + 1000000);
    const decrement = () => setCount(count - 1);

    return (
        <div className="h-screen">
            <h1 className="text-5xl font-bold mb-4">{count}</h1>
            <div className="flex space-x-4">
                <button
                    onClick={increment}
                    className="px-4 py-2 text-white bg-blue-500 rounded hover:bg-blue-600 transition"
                >
                    ПЛС
                </button>
                <button
                    onClick={decrement}
                    className="px-4 py-2 text-white bg-red-500 rounded hover:bg-red-600 transition"
                >
                    Минус
                </button>
            </div>
        </div>
    );
};

export default Counter;
